import React, { useState } from 'react';
import { Container, Form, Button } from 'react-bootstrap';
import './App.css'; // Import CSS file for styling

function App() {
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [gender, setGender] = useState('');
  const [occupation, setOccupation] = useState('');
  const [background, setBackground] = useState('bg1'); // Default background
  const [template, setTemplate] = useState('template1'); // Default template
  const [bioData, setBioData] = useState(null);

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = {
      name,
      age,
      gender,
      occupation,
      background,
      template
    };
    setBioData(data);
  };

  return (
    <Container>
      <h1>Biodata Generator for Marriage</h1>
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="name">
          <Form.Label>Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your name"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </Form.Group>

        <Form.Group controlId="age">
          <Form.Label>Age</Form.Label>
          <Form.Control
            type="number"
            placeholder="Enter your age"
            value={age}
            onChange={(e) => setAge(e.target.value)}
          />
        </Form.Group>

        <Form.Group controlId="gender">
          <Form.Label>Gender</Form.Label>
          <Form.Control
            as="select"
            value={gender}
            onChange={(e) => setGender(e.target.value)}
          >
            <option value="">Select gender</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
          </Form.Control>
        </Form.Group>

        <Form.Group controlId="occupation">
          <Form.Label>Occupation</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your occupation"
            value={occupation}
            onChange={(e) => setOccupation(e.target.value)}
          />
        </Form.Group>

        <Form.Group controlId="background">
          <Form.Label>Select Background</Form.Label>
          <Form.Control
            as="select"
            value={background}
            onChange={(e) => setBackground(e.target.value)}
          >
            <option value="bg1">Background 1</option>
            <option value="bg2">Background 2</option>
            <option value="bg3">Background 3</option>
          </Form.Control>
        </Form.Group>

        <Form.Group controlId="template">
          <Form.Label>Select Template</Form.Label>
          <Form.Control
            as="select"
            value={template}
            onChange={(e) => setTemplate(e.target.value)}
          >
            <option value="template1">Template 1</option>
            <option value="template2">Template 2</option>
            <option value="template3">Template 3</option>
          </Form.Control>
        </Form.Group>

        <Button variant="primary" type="submit">
          Generate Biodata
        </Button>
      </Form>

      {bioData && (
        <div className={`biodata-container ${background}`}>
          <div className={`biodata ${template}`}>
            <h2>Your Biodata</h2>
            <p>Name: {bioData.name}</p>
            <p>Age: {bioData.age}</p>
            <p>Gender: {bioData.gender}</p>
            <p>Occupation: {bioData.occupation}</p>
          </div>
        </div>
      )}
    </Container>
  );
}

export default App;
